import React from "react";
import ReactDOM  from "react-dom";
import Calc from "./{add, min, mul, div}"


ReactDOM.render(
    <>
      <h1>your Number is {Calc(10,10)} </h1>
      <h1>your Number is {Calc(10,5)} </h1>
      <h1>your Number is {Calc(10,10)} </h1>
      <h1>your Number is {Calc(10,2)} </h1>
    </>,
    document.getElementById("root")
);
